export default {
	question: `Hola soy profesor de universidad y quiero crear una pregunta para la plataforma Moodle en una nueva herramienta que se llama Qlowcode.
	funciona de la siguiente manera. Se programa en javascript.
	Te voy a explicar como funciona con dos ejemplos.

	EJEMPLO 1
	El problema que el profesor tiene que crear en Qlowcode para que resuelvan los alumnos es el siguiente:

	 Una empresa vende 0.8 toneladas de zumo  y 0.3 toneladas de sobrante por cada tonelada de materia prima. 
		El coste de la materia prima es de precio_mat €/toneladas, el zumo se vende a un precio de: 
		precio_zumo  €/toneladas .  El sobrante al 10%, es decir precio_sobrante €/toneladas, respectivamente. 

		El coste de producción viene dado por la función:

   Coste produccion (x)= 1,3  * x^3  siendo x el numero de toneladas.

   Siendo el coste total el de produccion mas el coste de la materia prima.

   Las ganancias brutas por tonelada de producción son: ganancias_brutas
   Por lo tanto, es necesario fabricar al menos: cantidad
   para que se alcance un maximo de ganancias de: ganancias

	 EL precio_mat es un numero al azar entre 1 y 5.

   Para definir el problema en Qlowcode es necesario crear dos funciones y solo estas dos:
	 La primera start. En ella se definen:
	   - los campos que el alumno debe rellenar en la aplicacion. Entre ellos deben estar las respuestas a la pregunta que el alumno debe responder. Esto se define con la funcion qlc.setFieldValue
	   - los resultados correctos calculados por la aplicacion. Esto se define con la funcion qlc.setResultVariable
	   - otras variables. Esto se define con la funcion qlc.setValue


	Una segunda funcion questionScript para realizar los calculos:	 

export default {
	data:{},

	start () {
		qlc.store = {};
		// Declarar campos a usar en equacion
		qlc.setFieldValue("precio_zumo",9);
		qlc.setFieldValue("ganancias_brutas",0);
		qlc.setFieldValue("ganancias",0);
		qlc.setFieldValue("cantidad",0);
		// Declarar resultados esperados
		qlc.setResultVariable("ganancias_brutas",null);
		qlc.setResultVariable("ganancias",null);
		qlc.setResultVariable("cantidad",null);
		// Inicializa variable
		qlc.setValue('precio_sobrante',0);
	},


		questionScript() {			
			qlc.setValue('precio_mat', qlc.aleaFloor (1,5,'seed') );
			qlc.setValue('precio_sobrante',qlc.getField('precio_zumo') / 10);
			qlc.setValue('precio_sobrante',qlc.getField('precio_zumo') / 10);
			let ingreso_total_tonelada = (0.8 * qlc.getField('precio_zumo')) + (0.3 * qlc.getValue('precio_sobrante')) - qlc.getValue('precio_mat');
			console.log('ingreso_total_tonelada '+ ingreso_total_tonelada)
			qlc.setResult('cantidad', Math.sqrt( ingreso_total_tonelada/ (3* 1.3)));
			qlc.setResult('ganancias_brutas',ingreso_total_tonelada);
			qlc.setResult('ganancias', ingreso_total_tonelada * qlc.getResult('cantidad') -  ( 1.3 * math.pow(qlc.getResult('cantidad'),3)));
			console.log(question.data)
		},

}

EJEMPLO 2

	El problema que el profesor tiene que crear en Qlowcode para que resuelvan los alumnos es el siguiente:	

En mi calculadora una de las teclas del 1 al 9 funciona mal, al apretarla aparece en pantallaun dígito entre 1 y 9 que no es el que corresponde con la tecla pulsada. Cuando traté de escribir el número 987654321, apareció en la pantalla un número con un digito repetido y otro que faltaba. Este numero es divisible por 11 y  deja resto 3 al dividirlo por 9.

¿Cuál es la tecla descompuesta? 
¿Cuál es el número que apareció en la pantalla?

El javascript buscado es el siguiente

export default {
	data:{},

	start () {
		qlc.start();
		qlc.setField("tecla", 0);
		qlc.setField("numero_aparecido", 10);
	},

	questionScript () {
		// El número base es '987654321'
		let baseNumero = "987654321";
		let multiploDe = 11;
		let resto = 3;

		for (let index = 0; index < baseNumero.length; index++) {
			for (let replacement = 1; replacement <= 9; replacement++) {
				// Convertimos el dígito a entero para hacer operaciones
				let digitoInt = parseInt(baseNumero[index], 10); 
				// Nos aseguramos de que no estemos reemplazando el dígito por sí mismo
				// y que al cambiar el dígito, la suma de los dígitos se incremente en 3
				if (replacement !== digitoInt) {
					// Creamos un nuevo número con el dígito reemplazado
					let nuevoNumero = baseNumero.substring(0, index) + replacement.toString() + baseNumero.substring(index + 1);
					// Convertimos el nuevo número a entero para hacer las verificaciones
					let nuevoNumeroInt = parseInt(nuevoNumero, 10);
					// Verificamos si el nuevo número es divisible por 11 y deja residuo de 3 al dividir por 9
					if (nuevoNumeroInt % multiploDe === 0 && nuevoNumeroInt % 9 === resto) {
						qlc.log(`El número modificado es: ${nuevoNumero}`);
						qlc.setResult("numero_aparecido", nuevoNumero);
						qlc.setResult("tecla", digitoInt);
						qlc.log(`El número modificado es: ${qlc.getResult("tecla")}`);
					}
				}
			}
		}

	}

}

Para hacer los calculos matematicos usa la libreria mathjs



