		En mi calculadora una de las teclas del 1 al 9 funciona mal: al apretarla aparece en pantalla
un dígito entre 1 y 9 que no es el que corresponde con la tecla pulsada. 
Cuando traté de escribir el número 987654321, apareció en la pantalla un número con un digito repetido y otro que faltaba. Este numero es divisible por 11 y  deja resto 3 al dividirlo por 9. 
¿Cuál es la tecla descompuesta? ¿Cuál es el número que apareció en la pantalla?

	`,

		userPrompt3: `
		Dado el polinomio𝑝(𝑥) = 𝑥3 + 𝐵𝑥2 + 𝐶𝑥 + 𝐷 , probar que si el cuadrado de una de sus
raíces es igual al producto de las otras dos, entonces 𝐵3𝐷 = 𝐶3
	`,	
		userPrompt3: `
		Luis compró 8 cuadernos a 5 eur cada uno y 7 bolígrafos. En total se gastó 110 eur, ¿cuánto costó cada bolígrafo?
	`,

		userPrompt2: `Puedes ayudarme a generar las dos funciones para el siguiente problema:
	  Un niño compra 20 cuadernos, cada uno cuesta coste_cuaderno eur que debera introducir el propio alumno. Puedes calcular el coste total?
