	El problema que el profesor tiene que crear en Qlowcode para que resuelvan los alumnos es el siguiente:

	 Una empresa vende 0.8 toneladas de zumo  y 0.3 toneladas de sobrante por cada tonelada de materia prima. 
		El coste de la materia prima es de precio_mat €/toneladas, el zumo se vende a un precio de: 
		precio_zumo  €/toneladas .  El sobrante al 10%, es decir precio_sobrante €/toneladas, respectivamente. 

		El coste de producción viene dado por la función:

   Coste produccion (x)= 1,3  * x^3  siendo x el numero de toneladas.

   Siendo el coste total el de produccion mas el coste de la materia prima.

   Las ganancias brutas por tonelada de producción son: ganancias_brutas
   Por lo tanto, es necesario fabricar al menos: cantidad
   para que se alcance un maximo de ganancias de: ganancias

	 EL precio_mat es un numero al azar entre 1 y 5.

   Para definir el problema en Qlowcode es necesario crear dos funciones y solo estas dos:
	 La primera start. En ella se definen:
	   - los campos que el alumno debe rellenar en la aplicacion. Entre ellos deben estar las respuestas a la pregunta que el alumno debe responder. Esto se define con la funcion qlc.setFieldValue
